import PopUpBook from "./PopUpBook";

const CardBook = ({
                      src,
                      title,
                      author,
                      description,
                      isTabletOrMobileDevice
                  }) => {
    return (
        <PopUpBook
            src={src}
            title={title}
            author={author}
            description={description}
            isTabletOrMobileDevice={isTabletOrMobileDevice}
        />
    );
};

export {
    CardBook as default
};
